import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useLocation, useNavigate } from 'react-router-dom';

function DataEntryForm() {
    const location = useLocation();
    const navigate = useNavigate();
    const hunterData = location.state || {};

    const [ime, setIme] = useState('');
    const [prezime, setPrezime] = useState('');
    const [adresa, setAdresa] = useState('');
    const [datumRodjenja, setDatumRodjenja] = useState('');
    const [kontakt, setKontakt] = useState('');
    const [korisnickoIme, setKorisnickoIme] = useState('');
    const [lozinka, setLozinka] = useState('');
    const [uloga, setUloga] = useState('');
    const [message, setMessage] = useState('');

    useEffect(() => {
        if (hunterData.lovac) {
            setIme(hunterData.lovac.ime);
            setPrezime(hunterData.lovac.prezime);
            setAdresa(hunterData.lovac.adresa);
            setDatumRodjenja(hunterData.lovac.datumRodjenja);
            setKontakt(hunterData.lovac.kontakt);
            setKorisnickoIme(hunterData.lovac.korisnickoIme);
            setUloga(hunterData.lovac.uloga);
        }
    }, [hunterData]);

    const handleSubmit = (event) => {
        event.preventDefault();
        const userData = {
            ime,
            prezime,
            adresa,
            datumRodjenja,
            kontakt,
            korisnickoIme,
            lozinka,
            uloga
        };

        const token = localStorage.getItem('token');
        const config = {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        };

        const url = hunterData.lovac ? `http://localhost:3000/update-lovca/${hunterData.lovac.brojLovackeIskaznice}` : 'http://localhost:3000/unos-lovca';
        const method = hunterData.lovac ? 'put' : 'post';

        axios[method](url, userData, config)
            .then(response => {
                setMessage(`Response: ${response.data.message}`);
                navigate('/popis-lovaca'); // Redirect back to the list after updating
            })
            .catch(error => {
                console.error('There was an error!', error);
                setMessage(`Error: ${error.message}`);
            });
    };

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#eee' }}>
            <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', margin: '50px', padding: '20px', borderRadius: '8px', boxShadow: '0 4px 8px rgba(0,0,0,0.1)', backgroundColor: '#f7f7f7' }}>
                <h1 style={{ color: '#333' }}>{hunterData.lovac ? 'AÅ¾uriraj Lovca' : 'Unos Lovaca'}</h1>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Ime:</label>
                    <input type="text" value={ime} onChange={(e) => setIme(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Prezime:</label>
                    <input type="text" value={prezime} onChange={(e) => setPrezime(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Adresa:</label>
                    <input type="text" value={adresa} onChange={(e) => setAdresa(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Datum roÄenja:</label>
                    <input type="text" value={datumRodjenja} onChange={(e) => setDatumRodjenja(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Kontakt:</label>
                    <input type="text" value={kontakt} onChange={(e) => setKontakt(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>KorisniÄko ime:</label>
                    <input type="text" value={korisnickoIme} onChange={(e) => setKorisnickoIme(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Lozinka:</label>
                    <input type="password" value={lozinka} onChange={(e) => setLozinka(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <div>
                    <label style={{ margin: '10px 0', fontWeight: 'bold' }}>Uloga:</label>
                    <input type="text" value={uloga} onChange={(e) => setUloga(e.target.value)} required style={{ margin: '10px 0', padding: '10px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }} />
                </div>
                <button type="submit" style={{ padding: '10px 20px', fontSize: '16px', color: 'white', backgroundColor: '#007BFF', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>{hunterData.lovac ? 'Update' : 'Submit'}</button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
}

export default DataEntryForm;
